import React, { Component } from 'react';
import 'tachyons';

const SubStyle = {
  color: "#fec503"
};

class ServiceDetails extends Component
{
    render()
    {
        return (
          <div>
            <h1 className="tc  f1 lh-title" style={SubStyle}>
              Details Of Our Services
            </h1>
            <p className="tc pa6 pt3 f4 lh-copy">
              With the advent of medical imaging technology, digital graphical
              representation of different parts of the body are readily
              available in different modalities, such as MRI, CT-Scan, and
              X-ray. That, along with the development in computer hardware
              technology, has made it possible for computer scientists to apply
              machine learning / pattern recognition techniques to classify
              images as either indicating a disease or not. That can be
              specifically useful for the detection of deadly diseases such as
              cancer and tuberculosis. Machines have an advantage over human
              expertise when it comes to identifying small changes in pixel
              values that are visually rather impossible to see, that may
              indicate the presence or absence of the disease. This project is
              an exercise in this direction to automate the disease detection
              process with achievement of high accuracy to be completed in a
              reasonably short amount of time, making it virtually online.
            </p>
            <h1 className="tc  f1 lh-title" style={SubStyle}>
              Why BrainTumor
            </h1>
          </div>
        );
    }
    }

export default ServiceDetails;
